import { useSelector } from "react-redux";
import Filter from "./Filter"; 
// import { changePlatform } from "../store/gameSlice";
import { changePrivacy } from "../store/groupSlice";

export default function PlatformFilter() {
  const privacy = useSelector(state=> state.groups.privacy )
  const options = [
    {
      value: 'Открытая',
      label: "Открытая",
    },
    {
      value: "Закрытая",
      label: "Закрытая",
    },
  ];
  return (
    <Filter
      placeholder="типу приватности"
      options={options}
      setFilter={changePrivacy}
      value={privacy}
    />
  );
}

